instruction: "LiveCodeBench Pro (Mini) - external judge.\n\nThe agent must create\
  \ a C++17 solution file at /app/main.cpp.\nThis task does not include local test\
  \ cases. Instead, the test harness:\n  1) POSTs the code to the external judge (/submit)\
  \ to get a sid,\n  2) polls GET /result/{sid}?short=1 until status == \"done\",\n\
  \  3) passes only if the judge returns passed == true.\n\nEnvironment variables\
  \ (overridable at runtime):\n  - BASE_URL: judge base URL (default http://38.80.122.117:8081)\n\
  \  - PID: problem id (default 2039D)\n  - LANG: language (default cpp)\n  - CODE_PATH:\
  \ path to code (default /app/main.cpp)\n  - JUDGE_TIMEOUT_SECS: poll timeout seconds\
  \ (default 120)\n\nShohag has an integer $n$ and a set $S$ of $m$ unique integers.\
  \ Help him find the lexicographically largest$^{\\\\text{∗}}$ integer array $a\\\
  _1, a\\_2, \\\\ldots, a\\_n$ such that $a\\_i \\\\in S$ for each $1 \\\\le i \\\\\
  le n$ and $a\\_{\\\\operatorname{gcd}(i, j)} \\\\neq \\\\operatorname{gcd}(a\\_i,\
  \ a\\_j)$$^{\\\\text{†}}$ is satisfied over all pairs $1 \\\\le i \\\\lt j \\\\\
  le n$, or state that no such array exists.\n\n$^{\\text{∗}}$An array $a$ is lexicographically\
  \ larger than an array $b$ of the same length if $a \\ne b$, and in the first position\
  \ where $a$ and $b$ differ, the array $a$ has a larger element than the corresponding\
  \ element in $b$.\n\n$^{\\\\text{†}}$$\\\\gcd(x, y)$ denotes the [greatest common\
  \ divisor (GCD)](https://en.wikipedia.org/wiki/Greatest_common_divisor) of integers\
  \ $x$ and $y$.\n\n### Input\n\nThe first line contains a single integer $t$ ($1\
  \ \\le t \\le 10^4$) -- the number of test cases.\n\nThe first line of each test\
  \ case contains two integers $n$ and $m$ ($1 \\le m \\le n \\le 10^5$).\n\nThe second\
  \ line contains $m$ unique integers in increasing order, representing the elements\
  \ of the set $S$ ($1 \\le x \\le n$ for each $x \\in S$).\n\nIt is guaranteed that\
  \ the sum of $n$ over all test cases does not exceed $3 \\cdot 10^5$.\n\n### Output\n\
  \nFor each test case, if there is no solution print $-1$, otherwise print $n$ integers --\
  \ the lexicographically largest integer array that satisfies the conditions.\n\n\
  ### Example\n\n#### Input #1\n\n```\n\n3\n\n6 3\n\n3 4 6\n\n1 1\n\n1\n\n2 1\n\n\
  2\n\n```\n\n#### Output #1\n\n```\n6 4 4 3 4 3\n1\n-1\n```\n\n### Note\n\nIn the\
  \ first test case, every element in the array belongs to the given set $S = \\{3,\
  \ 4, 6\\}$, and all pairs of indices of the array satisfy the necessary conditions.\
  \ In particular, for pair $(2, 3)$, $a_{\\operatorname{gcd}(2, 3)} = a_1 = 6$ and\
  \ $\\operatorname{gcd}(a_2, a_3) = \\operatorname{gcd}(4, 4) = 4$, so they are not\
  \ equal. There are other arrays that satisfy the conditions as well but this one\
  \ is the lexicographically largest among them.\n\nIn the third test case, there\
  \ is no solution possible because we are only allowed to use $a = [2, 2]$ but for\
  \ this array, for pair $(1, 2)$, $a_{\\operatorname{gcd}(1, 2)} = a_1 = 2$ and $\\\
  operatorname{gcd}(a_1, a_2) = \\operatorname{gcd}(2, 2) = 2$, so they are equal\
  \ which is not allowed!"
max_agent_timeout_sec: 300
max_test_timeout_sec: 180
